import React, { Component} from 'react';
import tasks from '../sample/tasks.json';

console.log(tasks);


export default class Task extends Component{

    state={
        tareas: tasks
    }

    render(){
        return (

            <div>
                {this.state.tareas.map( item =>
                     <p key={item.id} >{item.description } - 
                        {item.title} - 
                        {item.id} - 
                        {item.done}                                
                     </p>)}
            </div>
        )}

}
